import "./App.css";

function App() {
  const names = [
    "Hooyo",
    "Abti",
    "Najad",
    "Hanad",
    "Ahmed",
    "Ruwaydah",
    "Rayana",
  ];

  return (
    <div className="App">
      <h1>{names[0]}</h1>
    </div>
  );
}

export default App;
